const p = new Promise(function(resolve,reject) {
  resolve(getNumber(10));

} )

p.then((value)=> {

  if(value % 5 == 0){
    reject(value)
  }

})

function getNumber(max){
  return Math.floor(Math.random() * max) + 1;
}
